import React, { useContext, useEffect } from 'react';
import { 
  Container, 
  Typography, 
  Paper, 
  Box, 
  Button, 
  List, 
  ListItem, 
  ListItemText, 
  ListItemSecondaryAction,
  Divider,
  Grid,
  CircularProgress
} from '@mui/material';
import { TokenContext } from '../context/TokenContext';

const AdminPanel = () => {
  const { 
    tokens, 
    loading, 
    serveToken, 
    currentMaleToken,
    currentFemaleToken,
    fetchTokens
  } = useContext(TokenContext);

  // Fetch tokens on component mount
  useEffect(() => {
    fetchTokens('male');
    fetchTokens('female');
  }, [fetchTokens]);

  const handleServeToken = async (tokenId, gender) => {
    try {
      await serveToken(tokenId, gender);
    } catch (error) {
      console.error('Error serving token:', error);
    }
  };

  const formatTime = (dateString) => {
    if (!dateString) return '';
    const date = new Date(dateString);
    return date.toLocaleTimeString([], { hour: '2-digit', minute: '2-digit' });
  };

  const getStatusColor = (status) => {
    switch (status) {
      case 'served':
        return 'success';
      case 'waiting':
        return 'warning';
      default:
        return 'default';
    }
  };

  const getGenderIcon = (gender) => (
    gender === 'male' ? 
      <MaleIcon color="primary" fontSize="small" /> : 
      <FemaleIcon color="secondary" fontSize="small" />
  );

  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      <Typography variant="h4" component="h1" gutterBottom>
        Admin Dashboard
      </Typography>

      {/* Current Token Display */}
      <Paper sx={{ mb: 4, p: 3, borderRadius: 2, bgcolor: 'background.paper' }}>
        <Tabs 
          value={activeTab} 
          onChange={handleTabChange} 
          variant="fullWidth"
          indicatorColor="primary"
          textColor="primary"
          sx={{ mb: 3 }}
        >
          <Tab 
            icon={<MaleIcon />} 
            label="Men's Queue" 
            iconPosition="start" 
          />
          <Tab 
            icon={<FemaleIcon />} 
            label="Women's Queue" 
            iconPosition="start" 
          />
        </Tabs>

        <Box sx={{ p: 2, textAlign: 'center' }}>
          <Typography variant="h5" gutterBottom>
            Currently Serving: {currentToken ? `#${currentToken.token_number}` : 'None'}
          </Typography>

          {currentToken && (
            <Box sx={{ 
              mt: 2, 
              p: 3, 
              bgcolor: 'action.hover', 
              borderRadius: 2,
              textAlign: 'left',
              maxWidth: 400,
              mx: 'auto'
            }}>
              <Box sx={{ display: 'flex', alignItems: 'center', mb: 1 }}>
                <Avatar sx={{ bgcolor: currentGender === 'male' ? 'primary.main' : 'secondary.main', mr: 2 }}>
                  {currentGender === 'male' ? <MaleIcon /> : <FemaleIcon />}
                </Avatar>
                <Typography variant="h6">
                  {currentToken.name}
                </Typography>
              </Box>
              <Box sx={{ pl: 8, mt: 1 }}>
                <Box sx={{ display: 'flex', alignItems: 'center', mb: 0.5 }}>
                  <PhoneIcon color="action" fontSize="small" sx={{ mr: 1 }} />
                  <Typography variant="body1">{currentToken.phone}</Typography>
                </Box>
                <Box sx={{ display: 'flex', alignItems: 'center', mb: 0.5 }}>
                  <AccessTimeIcon color="action" fontSize="small" sx={{ mr: 1 }} />
                  <Typography variant="body2" color="text.secondary">
                    {formatTime(currentToken.created_at)}
                  </Typography>
                </Box>
                <Chip 
                  label={currentToken.service}
                  color={currentGender === 'male' ? 'primary' : 'secondary'}
                  size="small"
                  sx={{ mt: 1 }}
                />
              </Box>
            </Box>
          )}
        </Box>
      </Paper>

      {/* Token Queue */}
      <Paper sx={{ borderRadius: 2, overflow: 'hidden' }}>
        <Box sx={{ p: 2, bgcolor: activeTab === 0 ? 'primary.main' : 'secondary.main' }}>
          <Typography variant="h6" color="white">
            {currentGender === 'male' ? "Men's" : "Women's"} Token Queue
            <Chip 
              label={`${tokenList.filter(t => t.status === 'waiting').length} waiting`}
              size="small"
              sx={{ ml: 2, color: 'white', bgcolor: 'rgba(255, 255, 255, 0.2)' }}
            />
          </Typography>
        </Box>

        {loading ? (
          <Box sx={{ display: 'flex', justifyContent: 'center', p: 4 }}>
            <CircularProgress />
          </Box>
        ) : (
          <List sx={{ p: 0 }}>
            {tokenList.length === 0 ? (
              <ListItem>
                <Typography color="text.secondary" sx={{ textAlign: 'center', width: '100%', py: 3 }}>
                  No tokens in the {currentGender} queue
                </Typography>
              </ListItem>
            ) : (
              tokenList
                .sort((a, b) => a.token_number - b.token_number)
                .map((token, index) => (
                  <React.Fragment key={token.id}>
                    <ListItem 
                      sx={{ 
                        bgcolor: token.status === 'served' ? 'action.hover' : 'background.paper',
                        opacity: token.status === 'served' ? 0.7 : 1,
                        transition: 'all 0.3s ease'
                      }}
                    >
                      <Box sx={{ display: 'flex', alignItems: 'center', mr: 2 }}>
                        <Avatar 
                          sx={{ 
                            bgcolor: currentGender === 'male' ? 'primary.light' : 'secondary.light',
                            color: 'white',
                            width: 40,
                            height: 40,
                            mr: 2
                          }}
                        >
                          {token.token_number}
                        </Avatar>
                      </Box>

                      <ListItemText
                        primary={
                          <Box sx={{ display: 'flex', alignItems: 'center' }}>
                            <Typography variant="subtitle1" sx={{ fontWeight: 'medium' }}>
                              {token.name}
                            </Typography>
                            <Chip 
                              label={token.service}
                              size="small"
                              sx={{ ml: 1, fontSize: '0.7rem' }}
                            />
                          </Box>
                        }
                        secondary={
                          <Box sx={{ display: 'flex', alignItems: 'center', mt: 0.5 }}>
                            <PhoneIcon fontSize="small" sx={{ mr: 0.5, color: 'text.secondary' }} />
                            <Typography variant="body2" color="text.secondary" sx={{ mr: 2 }}>
                              {token.phone}
                            </Typography>
                            <AccessTimeIcon fontSize="small" sx={{ mr: 0.5, color: 'text.secondary' }} />
                            <Typography variant="body2" color="text.secondary">
                              {formatTime(token.created_at)}
                            </Typography>
                          </Box>
                        }
                      />

                      <ListItemSecondaryAction>
                        <Box sx={{ display: 'flex', alignItems: 'center' }}>
                          <Chip 
                            label={token.status === 'served' ? 'Served' : 'Waiting'}
                            color={getStatusColor(token.status)}
                            size="small"
                            sx={{ mr: 2, minWidth: 80, fontWeight: 'medium' }}
                          />
                          <Button
                            variant="contained"
                            size="small"
                            color={currentGender === 'male' ? 'primary' : 'secondary'}
                            onClick={() => handleServeToken(token.id)}
                            disabled={token.status === 'served' || servingToken === token.id}
                            sx={{ minWidth: 120 }}
                          >
                            {servingToken === token.id ? (
                              <CircularProgress size={20} color="inherit" />
                            ) : token.status === 'served' ? (
                              'Served'
                            ) : (
                              'Mark as Served'
                            )}
                          </Button>
                        </Box>
                      </ListItemSecondaryAction>
                    </ListItem>
                    {index < tokenList.length - 1 && <Divider />}
                  </React.Fragment>
                ))
            )}
          </List>
        )}
      </Paper>
    </Container>
  );
};

export default AdminPanel;
